import PySimpleGUI as sg

sg.theme_background_color('white')

img_light_off = b''
img_light_on = b''

img_switch_off = b''
img_switch_on = b''

def turn_light_on():  window.Element('_LIGHT_STATUS_').Update(data=img_light_on)
def turn_light_off(): window.Element('_LIGHT_STATUS_').Update(data=img_light_off)

def flip_switch_on(key): window[key].update(image_data=img_switch_on)
def flip_switch_off(key): window[key].update(image_data=img_switch_off)

layout = [
         [sg.Image(data=img_light_off, key='_LIGHT_STATUS_')],
         [sg.Text('        ', background_color='white'), sg.Button('', image_data=img_switch_off, key='-SWITCH1-', button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0),
          sg.Button('', image_data=img_switch_off, key='-SWITCH2-', button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0),
          sg.Button('', image_data=img_switch_off, key='-SWITCH3-', button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0),
          sg.Button('', image_data=img_switch_off, key='-SWITCH4-', button_color=(sg.theme_background_color(), sg.theme_background_color()), border_width=0)]
       ]

# Create the Window
window = sg.Window('Light Bulb Switch', layout, margins=(50,10), border_depth=0)

switch_1_off = True
switch_2_off = True
switch_3_off = True
switch_4_off = True
light_off = True

while True:
    event, values = window.read()
    if event == '-SWITCH1-':
        flip_switch_on('-SWITCH1-') if switch_1_off else flip_switch_off('-SWITCH1-')
        switch_1_off = not switch_1_off
        turn_light_on() if light_off else turn_light_off()
        light_off = not light_off
    if event == '-SWITCH2-':
        flip_switch_on('-SWITCH2-') if switch_2_off else flip_switch_off('-SWITCH2-')
        switch_2_off = not switch_2_off
        turn_light_on() if light_off else turn_light_off()
        light_off = not light_off
    if event == '-SWITCH3-':
        flip_switch_on('-SWITCH3-') if switch_3_off else flip_switch_off('-SWITCH3-')
        switch_3_off = not switch_3_off
        turn_light_on() if light_off else turn_light_off()
        light_off = not light_off
    if event == '-SWITCH4-':
        flip_switch_on('-SWITCH4-') if switch_4_off else flip_switch_off('-SWITCH4-')
        switch_4_off = not switch_4_off
        turn_light_on() if light_off else turn_light_off()
        light_off = not light_off

    if event in (None, 'Cancel'):  # if user closes window or clicks cancel
        break

window.close()